        <Typography padding={1} width={'auto'} textAlign={'center'} border={'1px solid #ccc'} borderRadius={6}></Typography>

      </Box>
      <Box width={"70%"}>
      </Box>
    </Box> 
  )
};  

export default UserProfile;
